import { createStore } from 'redux'

function todos(state = {}, action) {
    switch (action.type) {
        case 'ADD_TODO':
            return state.todos.concat([action.text])
        default:
            return state
    }
}

const store = createStore(todos, {todos:["HIYA", "HELLLOOOO"]})

export default store
